import React from 'react';

import 'react-responsive-carousel/lib/styles/carousel.min.css';

const styles = {
  app: {
    textAlign: 'center',
    backgroundColor: '#f4f4f4',
    minHeight: '100%',
    maxWidth:'100%',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  header: {
    backgroundColor: '#333',
    color: 'white',
    padding: '10px',
    width: '100%',
    boxSizing: 'border-box',
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '100px',
    width: '100%',
    boxSizing: 'border-box',
    marginTop: '0', // Removed space above the nav bar
  },
  logo: {
    marginLeft: '20px',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
  },
};

  const NavBar = () => (
    <nav style={{ ...styles.nav, marginTop: '0' }}> {/* Added marginTop: '0' */}
      <div style={styles.logo}>Logo</div>
      <ul style={styles.navUl}>
        <li style={styles.navLi}>Home</li>
        <li style={styles.navLi}>Our Missions</li>
        <li style={styles.navLi}>About Us</li>
        <li style={styles.navLi}>Clubs</li>
        <li style={styles.navLi}>Contact Us</li>
      </ul>
      <div style={styles.loginButton}>Login</div>
    </nav>
  );
  const ContactUs = () => (
    <div style={styles.App}>

      <NavBar />
    </div>
  );


  export default ContactUs;
